public class Swapping {

	/**
	 * @param args
	 */
	public static void main(String[] args) {
		// TODO Auto-generated method stub
		int x = 10;
		int y = 20;
		int z = x;
		x = y;
		y = z;
		System.out.println("x = " + x);
		System.out.println("y = " + y);
		
		

	}

}
